    render() {
        console.log(this.props.activity)
        return (
            <div>
            {this.props.description} <br/> 
            {this.props.date} <br/> 
            {this.props.time} <br/> <br/>
            <Button onClick={() => this.props.actDelete(this.props.activity.id)} > Delete Activity </Button>
            </div>
        )
    }
}
